import React from 'react';
import './collection.styles.scss';

import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';
import { selectShopCollectionsCollection } from '../../redux/shop/shop.selectors';

import CollectionItem from '../../components/collection-item/collection-item.component';

const CollectionPage = ({ match, collection }) => {
    console.log(match.params.collectionId)
    return (
        <div className="collection-page">
            {collection.map(collectionItem => <CollectionItem item={collectionItem} />)}
        </div>
    );
};

const mapStateToProps = createStructuredSelector({
    collection: selectShopCollectionsCollection(match.params.collectionId)
})

export default connect(mapStateToProps)(CollectionPage);
